INSERT INTO `events_event` VALUES (12,'IGNITION','NIT Raipur','2019-08-31','TBD','Every human mind blossoms with numerous ideas. But what really matters is its\r\nimplementation.\r\nAre you someone who has a knack of analyzing strategic advantages and pitfalls\r\ncompanies face? Then, Ignition- the B-Model competition is the perfect room to\r\ndevelop your own B-Model. Also, get a chance to be funded. So, aspirants get ready to\r\nput your thinking caps on as you\'ll be grilled with a barrage of questions regarding your\r\nprototype. The only thing which matters here is how well you can formulate your idea.\r\nEverything else is inconsequential here. We are anticipating for the ‘next big thing’. Are\r\nyou ready?','static/uploads/events/cover/ig111.png','static/uploads/events/icon/ig111.png','bmodel.ecellnitrr@gmail.com',1,2019,'2019-07-26 13:38:06.046435','2019-08-30 07:28:55.716426',NULL,'<div>Every human mind blossoms with numerous ideas. But what really matters is its implementation. Are you someone who has a knack of analyzing strategic advantages and pitfalls companies face? Then, Ignition- the B-Model competition is the perfect room to develop your own B-Model. Also, get a chance to be funded. So, aspirants get ready to put your thinking caps on as you\'ll be grilled with a barrage of questions regarding your prototype. The only thing which matters here is how well you can formulate your idea. Everything else is inconsequential here. We are anticipating for the ‘next big thing’. Are you ready?</div>'),(13,'START-UP CAMP','1 September\r\nDDU Auditorium','2019-08-31','12 - 5 PM','In a startup nothing happens unless you make it happen. Startup camp promotes entrepreneurship among students and also provides a start-up initiative activity amongst the growing startups in and around Chhattisgarh. Several high scale and low scale startups in and around Chhattisgarh are invited and provided with an opportunity to publicize their products/services and grab some interns for their companies. The investors attend the pitches of the startups and on recognizing a potential startup, provide seed funding to those startups.','static/uploads/events/cover/sc111.png','static/uploads/events/icon/sc111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:14.032085','2019-08-30 07:31:39.522765',NULL,'<p>In a startup nothing happens unless you make it happen. Startup camp promotes entrepreneurship among students and also provides a start-up initiative activity amongst the growing startups in and around Chhattisgarh. Several high scale and low scale startups in and around Chhattisgarh are invited and provided with an opportunity to publicize their products/services and grab some interns for their companies. The investors attend the pitches of the startups and on recognizing a potential startup, provide seed funding to those startups.<br></p>'),(14,'CRICNOMETRICA','31 August\r\nDDU Auditorium','2019-08-31','10 AM','Believe you know it all about cricket? Are you a master in cricket analysis and\r\ngameplay?\r\nThen brace yourselves and put your Cricket Gyaan to the grill. Cricnometrica features\r\nthe perfect platform where brilliant minds like yours can be used to bid players and\r\ncreate a fantasy premier league team. Here, we have auctions beyond actions so, just\r\nbid it out!','static/uploads/events/cover/cr111_wKu2qYt.png','static/uploads/events/icon/cr111_wKu2qYt.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:21.254730','2019-08-30 07:35:57.231370',NULL,'<p>Believe you know it all about cricket? Are you a master in cricket analysis and gameplay? Then brace yourselves and put your Cricket Gyaan to the grill. Cricnometrica features the perfect platform where brilliant minds like yours can be used to bid players and create a fantasy premier league team. Here, we have auctions beyond actions so, just bid it out!</p>'),(15,'B-QUIZ','31st August (Prelims)\r\nDDU Auditorium','2019-08-31','12:30 PM','Watch out!!!\r\nHere comes B-Quiz, ready to challenge your knowledge. Unlock your knowledge at the\r\nspeed of thought. Questions are certainly worth thinking about.\r\nAre you ready to conquer everyone and mark your place? Open for all the geniuses out\r\nthere...','static/uploads/events/cover/bq111.png','static/uploads/events/icon/bq111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:28.778598','2019-08-30 07:33:59.985031',NULL,'<p>Watch out!!!</p><p>Here comes B-Quiz, ready to challenge your knowledge. Unlock your knowledge at the speed of thought. Questions are certainly worth thinking about. Are you ready to conquer everyone and mark your place? Open for all the geniuses out there...</p>'),(16,'WALLSTREET','31 August (Round 1)\r\nDDU Auditorium','2019-08-31','12:30 PM','“Bazaar chalu Che?” Playing big games with big racks, this will test you in all the\r\ndirections on how good you are, with money trading and maximizing profit. Wallstreet\r\nis a virtual stock market trading game, just simulating the real world one, a competition\r\nfor making money, among your peers. Win big, go home big. Don’t miss a chance to\r\nthis enlightening and challenging event, happening this E-Summit’19.','static/uploads/events/cover/wallstreet_FwBl6yR111.png','static/uploads/events/icon/wallstreet_FwBl6yR111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:38.916571','2019-08-30 07:33:28.878020',NULL,'<p>“Bazaar chalu Che?” Playing big games with big racks, this will test you in all the directions on how good you are, with money trading and maximizing profit. Wallstreet is a virtual stock market trading game, just simulating the real world one, a competition for making money, among your peers. Win big, go home big. Don’t miss a chance to this enlightening and challenging event, happening this E-Summit’19.</p>'),(17,'UTHKRISHTH','31st August\r\nDDU Auditorium','2019-08-31','12 PM','No one has ever become poor by giving. \"Think of giving not only as a duty but as a\r\nprivilege.\"\r\nThere are some generous people in the society who are willing and giving enough to lift\r\nup not only themselves but also thousands of others who are struggling for better living.\r\nAt Uthkrishth we aim to felicitate such gems of society. Be there to witness the passion\r\nof love, humanity, charity, kindness and to applaud the \'best of the rest\'.','static/uploads/events/cover/uk111.png','static/uploads/events/icon/uk111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:48.703142','2019-08-30 07:34:37.274022',NULL,'<p>No one has ever become poor by giving. \"Think of giving not only as a duty but as a privilege.\" There are some generous people in the society who are willing and giving enough to lift up not only themselves but also thousands of others who&nbsp; At Uthkrishth we aim to felicitate such gems of society. Be there to witness the passion of love, humanity, charity, kindness and to applaud the \'best of the rest\'.</p>'),(18,'ENTROPY','31st August\r\nDDU Auditorium','2019-08-31','11 Am','Creating sparks and keeping the flame lit, for our budding pals, kindling their inner\r\nentrepreneur, these top-notch speakers describe business models and the under\r\nduress moments of running a company. Entropy aims to facilitate the young\r\nentrepreneurs by directly getting advice from the best, the people who’ve had a\r\nfirst-hand experience at the obstacles of Entrepreneurship. We are excited to have you\r\non board this E-Summit.','static/uploads/events/cover/en111.png','static/uploads/events/icon/en111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:38:55.298656','2019-08-30 07:35:08.115422',NULL,'<p>Creating sparks and keeping the flame lit, for our budding pals, kindling their inner entrepreneur, these top-notch speakers describe business models and the under duress moments of running a company. Entropy aims to facilitate the young entrepreneurs by directly getting advice from the best, the people who’ve had a first-hand experience at the obstacles of Entrepreneurship. We are excited to have you on board this E-Summit.</p>'),(19,'E-GATHERING','1 September\r\nDDU Auditorium','2019-08-31','6 - 8 PM','Like to end the E summit 18 on a high, the closing ceremony called the E-Gathering will feature a musical performance and a stand-up performance which will be revealed soon.','static/uploads/events/cover/eg111.png','static/uploads/events/icon/eg111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:39:02.570581','2019-08-30 07:32:25.998188',NULL,'<p><span style=\"color: rgb(206, 231, 247);\">Like to end the E summit 19 on a high, the closing ceremony called the E-Gathering will feature a musical performance and a stand-up performance which will be revealed soon.</span><br></p>'),(20,'B-CASE STUDY','DDU Auditorium','2019-08-31','TBD','Problems are nothing but wake-up calls for creativity.\r\nThis is our call for all the innovative and brilliant minds to test their boundaries.\r\nRemember that the biggest competition is to fight yourself. So use your hammer to nail\r\ndown our problems.\r\nDon\'t miss B-Case Study in E-Summit 2k19. Opportunities don\'t come often, you need\r\nto create some.','static/uploads/events/cover/bc111.png','static/uploads/events/icon/bc111.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:39:09.840846','2019-08-28 11:11:24.660575',NULL,'<p>Problems are nothing but wake-up calls for creativity. This is our call for all the innovative and brilliant minds to test their boundaries. Remember that the biggest competition is to fight yourself. So use your hammer to nail down our problems. Don\'t miss B-Case Study in E-Summit 2k19. Opportunities don\'t come often, you need to create some.</p>'),(22,'INNOVATION MANTHAN','DDU Auditorium','2019-09-01','TBD','A stepping stone for your future startup ideas.','static/uploads/events/cover/Event_Logos-20.png','static/uploads/events/icon/Event_Logos-20.png','precellnitrr@gmail.com',1,2019,'2019-07-26 13:39:19.490019','2019-08-28 11:07:13.201880',NULL,'<h1 class=\"western\"><div><b style=\"font-size: 20pt; color: rgb(206, 222, 231);\">Theme</b><br></div></h1>\r\n<p style=\"margin-bottom: 0in\">We aim to support UNICEF and the SDGs\r\ngoals with your brilliant(pragmatic) project idea. Please do mark\r\nbelow points fulfilled by your project in the form.</p>\r\n<p style=\"margin-bottom: 0in\"><br>\r\n\r\n</p>\r\n<p style=\"margin-bottom: 0in\"><i>SUSTAINABLE DEVELOPMENT</i></p>\r\n<ol>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">No poverty</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Zero Hunger</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Good Health and well being</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Quality Education</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Gender Equality</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Clean Water and sanitization</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Affordable and clean energy</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Decent work and economic growth \r\n	</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Industry, innovation and\r\n	infrastructure</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Reduced inequalities</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Sustainable cities and\r\n	communities</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Responsible consumption and\r\n	production</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Climate action</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Life below water</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Life on land</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Peace, justice and strong\r\n	institutions</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Partnership for the goals</p>\r\n</li></ol><h1 class=\"western\"><b style=\"color: rgb(214, 239, 214);\">Prize</b></h1><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">Selected teams will be given a\r\n	seed grant of Rs. 25000 and access to Makerspace and Mentorship\r\n	(alumni network) and Patenting.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Top team from each domain will\r\n	be given Goodies worth (according to spons) and free entry to our 5\r\n	day workshop (approximately during October).</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">All selected teams will be\r\n	eligible for attending the <b>Design thinking workshop</b>.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">All the finalists will be given\r\n	a time period to develop their prototypes after which they will be\r\n	given Rs. 50,000 as acceleration grant (if eligible).</p>\r\n</li></ul><h1 class=\"western\"><b style=\"color: rgb(206, 222, 231);\">Perks</b></h1><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">Certificate of participation.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Publicity of all teams through\r\n	social media platforms.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Food and refreshments all teams.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">ID cards for all participants.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Set up of booth.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Proper electricity supply during\r\n	prototype presentation.</p>\r\n</li></ul><h1 class=\"western\"><span style=\"color: rgb(206, 222, 231);\"><a name=\"_de2czhbpdal0\"></a><b style=\"\">Judges</b></span></h1><p style=\"margin-bottom: 0in\">Senior Faculties, 36Inc…</p><p style=\"margin-bottom: 0in\">Chief guest - distribution of prizes</p><h1 class=\"western\"><span style=\"color: rgb(206, 222, 231);\"><a name=\"_x6gprwqg3a08\"></a><b style=\"\">Rules\r\nand Regulation</b></span></h1><p style=\"margin-bottom: 0in\"><i>REGISTRATION:</i></p><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">Teams can register through\r\n	google form. Details like name, college, team name, team leader name\r\n	+ contact(WhatsApp + call), Project name, and abstract in pdf/docx\r\n	format must be submitted. (links to videos/ photos to for working\r\n	prototypes (optional))</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">40 Selected teams will be\r\n	informed to the team leader through email and SMS on the basis of\r\n	abstracts and originality of the ideas.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Teams will be given details\r\n	about the Lean canvas that they must prepare which will cover points\r\n	like Problem statement, Solution, Value proposition, (Revenue Model)\r\n	etc. This Lean canvas should be printed by teams in A3 sheets.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\"><i>Selected teams are\r\n	compulsorily required to maintain softcopy as well as hard copy of\r\n	lean canvas before final day.</i></p>\r\n</li></ul><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">Students must have a lean canvas\r\n	ready during the final presentation day which should be of specific\r\n	format as described in (). Also maintain an online copy of the same.</p>\r\n	</li><li>\r\n<p style=\"margin-bottom: 0in\">Per team the presentation time\r\n	limit in front of judges will be restricted to 5 mins.</p>\r\n</li></ul><p style=\"margin-left: 0.75in; margin-bottom: 0in\">Booths will be set\r\nup by 9 am and can be visited till 12 pm. It is mandatory that at\r\nleast 1 person should be present near the booth.</p><p style=\"margin-left: 0.75in; margin-bottom: 0in\"><br></p><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\"><i>Maximum no. Of participants\r\n	in a team is 4 and minimum 1.</i> (all team members must be from the\r\n	same college). <i>College</i> should be within <i>Chhattisgarh</i>\r\n	region.</p>\r\n</li></ul><p>\r\n	\r\n	\r\n	<style type=\"text/css\">\r\n		@page { margin: 0.79in }\r\n		h1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n		h1.western { font-family: \"Arial\", serif; font-size: 20pt; font-weight: normal }\r\n		h1.cjk { font-size: 20pt; font-weight: normal }\r\n		h1.ctl { font-size: 20pt; font-weight: normal }\r\n		p { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n	</style>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><ul>\r\n	<li>\r\n<p style=\"margin-bottom: 0in\">All the required documents must\r\n	be submitted before the final round.</p><p style=\"margin-bottom: 0in\"><br></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 24px; color: rgb(206, 222, 231);\"><b><u>Terms And Conditions</u></b></span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 24px; color: rgb(206, 222, 231);\"><b><u><br></u></b></span><font style=\"font-size: 12pt;\"><span lang=\"en-US\">1. Among the participating teams, 3 teams would be ranked 1</span></font><sup style=\"font-size: 10.5px;\"><font style=\"font-size: 12pt;\"><span lang=\"en-US\">st</span></font></sup><font style=\"font-size: 12pt;\"><span lang=\"en-US\">, 2</span></font><sup style=\"font-size: 10.5px;\"><font style=\"font-size: 12pt;\"><span lang=\"en-US\">nd</span></font></sup><font style=\"font-size: 12pt;\"><span lang=\"en-US\">, 3</span></font><sup style=\"font-size: 10.5px;\"><font style=\"font-size: 12pt;\"><span lang=\"en-US\">rd</span></font></sup><font style=\"font-size: 12pt;\"><span lang=\"en-US\">&nbsp;in order of performance.</span></font></p><p style=\"margin-bottom: 0in\"><font style=\"font-size: 12pt;\"><span lang=\"en-US\"><br></span></font><span style=\"font-size: 12pt;\">2. The top performing team(s) would be given a chance to be incubated under NIT Raipur.</span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">3. Incubation includes the following provisions</span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">&nbsp; &nbsp; a. Seed Grant of Rs. 25000 would be provided for prototype (applicable for NIT Students).</span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">&nbsp; &nbsp; b. Acceleration Grant of Rs. 50000 would be provided (applicable for NIT and non-NIT students).</span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">&nbsp; &nbsp; c.Access to Makerspace and Mentorship would be provided (applicable for NIT and non-NIT students)</span></p><p style=\"margin-bottom: 0in\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">4. If the teams do not submit the required documents in the given time, they would not be eligible for the above provisions.&nbsp;&nbsp;</span></p>\r\n</li></ul><style type=\"text/css\">\r\n		@page { margin: 0.79in }\r\n		h1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n		h1.western { font-family: \"Arial\", serif; font-size: 20pt; font-weight: normal }\r\n		h1.cjk { font-size: 20pt; font-weight: normal }\r\n		h1.ctl { font-size: 20pt; font-weight: normal }\r\n		p { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n	</style><style type=\"text/css\">\r\n		@page { margin: 0.79in }\r\n		h1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n		h1.western { font-family: \"Arial\", serif; font-size: 20pt; font-weight: normal }\r\n		h1.cjk { font-size: 20pt; font-weight: normal }\r\n		h1.ctl { font-size: 20pt; font-weight: normal }\r\n		p { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n	</style><style type=\"text/css\">\r\n		@page { margin: 0.79in }\r\n		h1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n		h1.western { font-family: \"Arial\", serif; font-size: 20pt; font-weight: normal }\r\n		h1.cjk { font-size: 20pt; font-weight: normal }\r\n		h1.ctl { font-size: 20pt; font-weight: normal }\r\n		p { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n	</style><style type=\"text/css\">\r\n		@page { margin: 0.79in }\r\n		p { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 2; widows: 2 }\r\n	</style>');
