INSERT INTO `investors_investor` VALUES (5,'Gagan Gupta','Kyt Ventures',NULL,'static/uploads/investors/0.jpeg','gaganie@gmail.com','','Mr. Gupta is the\r\nCo-founder of Kyt Ventures. He is a Start-up\r\nand lean-business model\r\nspecialist. Mr. Gupta is a\r\nVenture Investor at Rajasthan Angel Innovators\r\nNetwork (RAIN) and a\r\nmember of TIE, Rajasthan. He is an active contributor to the Startup\r\nEcosystem as a jury\r\nmember and is a mentor,\r\nguide and advisor for\r\nmany young Startup entrepreneurs. Mr. Gupta\r\nhas been an investor for\r\nClearDekho.com, Meetingsandoffices.com, Intelitaap Solutions, Kalaage,\r\nEdgefx Technologies,\r\nToko Innovations Studios\r\nPvt Ltd, ALBJ Technology\r\nVentures Pvt Ltd, hotify',2019,'http://linkedin.com/in/gaganie',1,'2019-08-25 06:06:58.713638','2019-08-26 07:34:56.938322'),(6,'Nitin Bardia','Anopchand Tilokchand Jewellers Private Limited',NULL,'static/uploads/investors/nitin_2.jpeg','info@atjewel.com','','The foundation of Anopchand\r\nTilokchand Jewellers Private\r\nLimited or AT Jewellers in\r\n1957. On the basis of his\r\nhard-work, innovative skills,\r\nsincere efforts, fair practice\r\nand commitment for customers’ satisfaction, AT Jewellers\r\nhas achieved tremendous\r\nsuccess & reputation and\r\nrecognized as a “Symbol of\r\nTrust”.',2019,'https://www.facebook.com/atjewellers',1,'2019-08-25 06:12:54.372465','2019-08-30 11:09:07.228761'),(7,'Ravi Ranjan','\"Starting up with Ravi Ranjan\"',NULL,'static/uploads/investors/Ravi_Ranjan.jpg','nomail@gmail.com','','Mr. Ravi is an Entrepreneurship Evangelist, Startup Expert, 2 Times TEDx\r\nSpeaker and an Alumni of\r\nThe International Visitor\r\nLeadership Program (IVLP),\r\na premier professional\r\nexchange program by U.S.\r\nGovt. Department of\r\nState\'s. He is the founder\r\nof “Starting up with Ravi\r\nRanjan”. He has over 10\r\nyears of experience helping\r\nStart-ups, Entrepreneurs\r\nand Govt. across India to\r\nsolve problems using Entrepreneurship, Technology,\r\nand Innovation. He is a\r\nregular Speaker at Top\r\nTechnology and Management Institutes in India\r\nsuch as IIT, IIM, NIT, XLRI,\r\nManipal, Amity, along with\r\nbeing a regular Speaker\r\nand Mentor at Startup\r\nEvents across India',2019,'http://linkedin.com/in/raviranjan2',1,'2019-08-25 06:19:35.343289','2019-08-26 07:34:38.712142'),(8,'Arjit Johri','Bharat Innovation Fund',NULL,'static/uploads/investors/Arjit_Johri.jpg','nomail@gmail.com','','Mr. Arijit Johri is a part of the\r\ninvestments and corporate\r\ndevelopment team at Bharat\r\nInnovation Fund. Mr. Johri, an\r\nMBA tech graduate in finance\r\nfrom Narsee Monjee Institute\r\nof management studies had\r\nalso been one of the\r\ncofounders and Trustee of\r\nProject Research Foundation,\r\na non-profit organization\r\nwhich is aimed to improve\r\nthe health sector in India with\r\nthe help of easy-to-use technology. Mr. Arjit Johri had\r\nalso been the manager of\r\nCorporate Development and\r\nAngel affiliations at Centre for\r\nIncubation and Entrepreneurship at IIM Ahmedabad. He\r\nhad also been a part of\r\nBharat Innovation Fund\r\ninvestments to Startups like\r\nPlaysifu and Creditvidya\r\nwhich have been recognised\r\nas one of the winners of the\r\ninclusive Fintech 50 award',2019,'http://linkedin.com/in/arjitjohri',1,'2019-08-25 06:23:39.074947','2019-08-25 06:23:39.075006'),(9,'Varun Bhatt','Unicorn India Ventures',NULL,'static/uploads/investors/varun_bhatt1.jpg','nomail@gmail.com','','Mr. Varun Bhatt is part of\r\nthe Investment team at UIV\r\nand works out of their\r\noffice in Mumbai. He\r\ncomes from various fields\r\nin finance with stints in\r\nM&A, equity hedge funds\r\nand running startups. He\r\nhas also had exposure\r\nglobally, working in\r\nLondon, Singapore, and\r\nIndonesia before his move\r\nto UIV Mumbai. His Startup\r\nexperience comes from\r\nbeing the head of business\r\ndevelopment at Rocket\r\nInternet’s Carmudi. A car\r\nmarketplace cum financing\r\ncompany based out of\r\nIndonesia with operations\r\nin the Philippines and Sri\r\nLanka. Here he was able to\r\nforge strong partnerships\r\nfor the company with\r\ngiants such as Go-Jek,\r\nAllianz and Bank Central.',2019,'http://www.unicornivc.com/equity/varun_bhatt.php',1,'2019-08-25 06:29:46.576630','2019-08-25 06:31:41.935602'),(10,'Amod  Yadav','Arclite | light solutions',NULL,'static/uploads/investors/amodyadav_Ta8Vrqm.jpg','info@arsonicinternational.com','','A management professional with 18 years of\r\nrich experience in business development, business management and\r\nturnkey project management. Had worked with\r\nIndian giants like Bajaj\r\nand Crompton before\r\nshifting to Dubai. Had\r\nserved as country head\r\nfor various country.\r\nStrong managerial background with senior level\r\ninternational experience\r\nand cross sector exposure. Excellent strategic\r\nvision, able to build and\r\nimplement strategic plans\r\nwith a proven track\r\nrecord explicitly supporting business needs.\r\nSelf-driven and self-reliant, sets goals and love\r\nto leads by example.',2019,'http://linkedin.com/in/amod-kumar-yadav-b4811515',1,'2019-08-25 06:32:15.490374','2019-08-25 06:40:40.061276'),(11,'Manjusha Manker','Arsonic International Private Limited',NULL,'static/uploads/investors/Manjusha_Manker_A36c7Zd.jpg','info@arsonicinternational.com','','She is an IT engineer \r\nwith 15 years of core\r\nexperience in India and\r\nabroad. She is currently managing her own\r\nbusiness as managing\r\nDirector at Arsonic\r\nInternational Private\r\nLimited, which provides IOT based solutions for Homes and\r\noffices Pan India.',2019,'https://www.linkedin.com/in/manjusha-manker-82222819',1,'2019-08-25 06:33:26.001953','2019-08-25 06:33:26.002006');
