y that counts and we stand by it. Here we focus on overall brand building—Public Relation, Marketing activities, Branding, Advertising and Perception Management.</p>\n<p></p>','IT','Office no 550, Golden Trade Centre, New Rajendra Nagar,','Raipur 492001','Raipur','Chhattisgarh','India',1,'2019-08-27 10:25:53.493382','2019-08-30 09:24:46.970278',923),(305,'Minocular','mohit@minocular.com','9111459999','Minocular -  web based mine intelligence solution','<p>Minoular offers complete enterprise drone solutions on a comprehensive platform , it provide end-to-end solutions that turn aerial data into actionable business intelligence for mining industry. Minocular\'s 3D visual intelligence platform use IOT to collect data and also proprietary algorithm to reduce cost and improve efficiency in mining operation.</p>','Technical , Business Development, Content Writing( Technical/Marketing)','1st floor Mishra Bada, Tatyapara chowk,','G.E. Road Raipur','Raipur','Chhattisgarh','India',1,'2019-08-27 10:38:30.570200','2019-08-30 09:24:42.536581',925),(306,'Jivandeep Health Services','contact@jivandeep.org','7415191234','India\'s first end to end solution for organ transplantation, emphasizing on sustainability and Rehabilitation','<ul>\n<li><a href=\"https://drive.google.com/file/d/1DdJuOjgkBQIliEh7UtzwMbA7TVzBvohv/view?usp=sharing\" target=\"_blank\">About Jivandeep</a>&nbsp;</li>\n<li><a href=\"https://drive.google.com/file/d/11BBeqwkZlYoEi1UfRXqGtHxbEIY-ZP0I/view?usp=sharing\" target=\"_blank\">About Founder</a>&nbsp;</li>\n<li><a href=\"https://www.facebook.com/groups/JivandeepCGbilaspur/\" target=\"_blank\">Jivandeep Facebook Group</a>&nbsp;</li>\n</ul>\n<p></p>','Healthcare Services','AIC@36 Inc, 3rd Floor,','City Centre Mall, Pandri.','Raipur','Chhattisgarh','India',1,'2019-08-27 11:34:04.805822','2019-08-30 09:24:41.063146',931),(307,'Kavel Safety Products Private Limited','vinod@kavel.in','9826357823','Manufacturing Industrial Safety & Road Safety Equipment’s','<p>KAVEL specializes in the field of Manufacturing Industrial Safety Equipment’s.</p>\n<p>We are working with the brand name “KAVEL“® started by 3 like minded peoples who already earned an experience of more than 12 years in the Industrial Safety Equipments living with a vision to contribute in achieving a noble goal of 100% Safety to all at every workplace and same is reciprocated by our tag line “Spreading Safety”.</p>','Industrial and Construction','GB02 , ML Business Park , Punjab Mill Galli , Bhainsthan','Ramsagar Para','Raipur','Chhattisgarh','India',1,'2019-08-27 11:36:16.862020','2019-08-30 09:24:39.100915',935),(308,'Rishiraj Surana','aeinak.design84@gmail.com','9644551188','Bethaarge-we care, we share','<p></p>','Product Design, technical','Aeinak Design Studio, shop no.  84, surana market','Behind city centre mall,  devendra nagar','Raipur','Chhattisgarh','India',1,'2019-08-27 12:04:33.338770','2019-08-30 09:24:37.424065',937),(309,'Pravesh jain','jpravesh111@gmail.com','8602022202','Self drive car rentals','<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: rgb(255,255,255);font-size: 14px;font-family: Exo 2\", sans-serif;\">, we felt your pain while travelling in a chauffeur driven car and thus we introduced </span><span style=\"color: rgb(231,76,60);background-color: rgb(255,255,255);font-size: 14px;font-family: Exo 2\", sans-serif;\">TRIPPY</span><span style=\"color: rgb(51,51,51);background-color: rgb(255,255,255);font-size: 14px;font-family: Exo 2\", sans-serif;\"> with a unique idea of </span><span style=\"color: rgb(231,76,60);background-color: rgb(255,255,255);font-size: 14px;font-family: Exo 2\", sans-serif;\">TRIPPY BULAO, KHUD CHALAO</span><span style=\"color: rgb(51,51,51);background-color: rgb(255,255,255);font-size: 14px;font-family: Exo 2\", sans-serif;\">.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: rgb(255,255,255);font-size: 14px;font-family: exo 2\", sans-serif;\">If you want to drive yourself and want comfort + luxury at a pocket-friendly price, then you are at the right place!</span><br><br></p>','Travel','Samta colony','Krishna talkies circle','Raipur','Chhatisgarh','India',1,'2019-08-27 12:45:54.667592','2019-08-30 09:24:36.028128',940),(310,'Ascent Edutech','gaganladdha@gmail.com','9993336391','Education Technology company','<p style=\"text-align:justify;\">&nbsp;<span style=\"background-color: white;font-size: 12pt;font-family: Times New Roman\", serif;\">Knowledge has no boundaries. Our<br>idea of e-learning classes is based on this concept only. This will help<br>student from any corner of country to learn and interact with expert faculty<br>from other corner for preparation of various competitive exams like GATE, ESE,<br>JEE, CGPSC, BANK PO etc. </span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"background-color: white;font-size: 12pt;font-family: Times New Roman\", serif;\">We prepare recorded lectures with<br>perfect use of technology. These are unique lectures with a perfect combination<br>of classroom teaching, 3d animation and industry interface which makes learning<br>more interesting and effective especially for Engineering and Technology. These<br>lectures are then sold in pen drive through our website and mobile application.<br>Live doubt clearing session are scheduled in which students can directly<br>interact with faculties for their doubts. </span>&nbsp;&nbsp;</p>','education technology','City center mall','pandari','raipur','Chhattisgarh','India',1,'2019-08-28 04:47:51.452987','2019-08-30 09:24:34.671677',1007),(311,'Traddle Intertrade Pvt. Ltd.','gawrav@traddle.in','8770467824','Marketplace for import-export of bulk agro-commodities','<p style=\"text-align:start;\"><span style=\"color: rgb(255,255,255);background-color: rgb(255,255,255);font-size: 14px;font-family: Ubuntu, sans-serif;\">.Traddle offers an online platform to businesses in the export-import arena, thus acting as trade facilitator or digital broker for parties involved in bulk trading of agro-commodities around the world.</span></p>\n<h3 style=\"text-align:start;\"><span style=\"color: rgb(255,255,255);background-color: rgb(255,255,255);font-size: 17px;font-family: Ubuntu, sans-serif;\">Who does TRADDLE serve?</span></h3>\n<p style=\"text-align:start;\"><span style=\"color: rgb(255,255,255);background-color: rgb(255,255,255);font-size: 14px;font-family: Ubuntu, sans-serif;\">Traddle serves companies engaged in import-export, international traders, brokers, farmers, processors, FMCG food industries, and government agencies trying to source raw materials besides corporates involved in multi-national operations throughout the world.</span></p>\n<h3 style=\"text-align:start;\"><span style=\"color: rgb(255,255,255);background-color: rgb(255,255,255);font-size: 17px;font-family: Ubuntu, sans-serif;\">Why TRADDLE?</span></h3>\n<p style=\"text-align:start;\"><span style=\"color: rgb(255,255,255);background-color: rgb(255,255,255);font-size: 14px;font-family: Ubuntu, sans-serif;\">Traddle provides first of its kind personal interface for traders and brokers to manage everything related to trade. It enables smoother execution of trade with effective handling of queries and negotiations associated with trade processes over its B2B marketplace. Hence, it Ensures Trade.</span></p>','Technical, Marketplace, Export, Import, agritech','D-3, Farishta Complex','GE Road','Raipur','Chhattisgarh','Raipur',1,'2019-08-28 05:40:23.394682','2019-08-30 09:24:32.982898',1016),(312,'whiteleo Industries Private Limited','mail@thewhiteleo.com','7471174747','Food and Beverages / Products and Services','<p>Involve in building the enviorment friendly products&nbsp;</p>','manufacturing','A 707 Babylon Tower, VIP Square','Great Eastern Road, Raipur','Raipur','Chhattisgarh','INDIA',1,'2019-08-28 08:13:54.564507','2019-08-30 09:24:31.481791',943),(313,'Kite (India Innovation Incorporation Pvt. Ltd)','people@kite.work','7011083702','Kite is Hiring for Research and Marketing Interns','<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">Kite powers a new, more equal digital economy.</span><br><br><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">Kite launched with the belief that Indian finance urgently needed a modern overhaul. As we saw it, the Indian economy ran on old-school tech and outdated thinking, where a bank was confined to its four walls, and millions still lacked access to basic financial opportunities. Businesses and consumers alike didn’t just need better finance solutions, but an entire ecosystem that offered them financial intelligence at their fingertips.</span> <br><br><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">So, we went ahead and built it. Kite’s financial intelligence platform links businesses to a suite of solutions, featuring fully-customizable corporate cards and personalized analytics. Today, businesses of all sizes—from startups to enterprises—are using Kite’s versatile platform to track sales team expenses, turn business incentives cashless, maximize employee tax savings, and much more.</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">To accomplish this hugely challenging and immensely rewarding goal, we want to bring on board sales &amp; marketing interns to join a fast-growing team of friendly, creative individuals with diverse passions and backgrounds. You’ll be working directly with the Founders of the startup. If you’re down to join the Kite Crew, hit us up!</span></p>\n<p></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">In your position at Kite, you will:</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Help manage the full sales-cycle, including contract generation and other deliverables for closing.</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Proactively call new users to help them sign up, onboard, and run their first transaction with Kite</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Visit potential clients at offices and distribute marketing materials / explain the value proposition</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Present Kite’s value proposition and solutions using appropriate value-based sales approaches and techniques, including team and/or consultative presentations and efforts.</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Assist with the technical onboarding of the customers’ Kite account</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Drive a high volume of sales by managing the complete sales process</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Hit Monthly / Quarterly Sales Goals</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Interface with all levels of the target clients, including Finance, HR/Recruiting, Legal</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Collaborate and lead successful execution of sales activities with internal cross-functional teams, with senior management, through contract negotiation and signed contracts</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Manage all sales activity and monthly forecasting of revenue in the CRM</span></p>\n<p></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">It’s essential that you:</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Are hands-on and execute quickly</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Want to work in a growth-stage startup</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Have strong communication skills and can speak English &amp; Hindi</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">- Are available for a period of at least 3 months</span></p>\n<p></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">Other specifics:</span></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">Location: Delhi-NCR</span></p>\n<p></p>\n<p></p>\n<p><span style=\"color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue\", arial, helvetica, freesans, \"liberation sans\", \"numbus sans l\", sans-serif;\">If interested, please apply at https://angel.co/kiteforbusiness/jobs or email people@kite.work. Please look over https://kite.work to review our products.</span></p>','Fintech','249/A, 2nd Flr,','Okhla Phase 3','New Delhi','Delhi','India',1,'2019-08-28 09:56:54.011396','2019-08-30 09:24:29.862340',1020),(314,'dhfsjk','kkkj@kfgk.com','9662870703','efkjgk','<p>fjkdsjgknre</p>\n<p>fkjskgj</p>\n<p>lkfrjlkjg</p>','Consulting','gsngkn','jgklsjgk','fsngk','sgnlksf','sgkfjd',0,'2019-08-28 12:20:04.146357','2019-08-28 12:21:52.342098',1028),(315,'Digiabled','kunal@eduventures.in','09893682444','Creating Livelihood opportunities for rural youths','<p>We are social enterprise involved in providing training &amp; employment to differently-abled youth. Under our DIgiabled initiative we are trying to provide employment to differently-abled youths located in remote areas. These differently-abled are assembling LED Lamps, PowerBank, Speakers etc in a unit established by us at their districts.&nbsp;</p>','Social Enterprise','Sureskills, Surana Law College Campus','Opposite Ravishankar Stadium, Gaurav Path','Durg','Durg','India',1,'2019-08-28 13:01:25.689150','2019-08-30 09:24:26.891453',942),(316,'final test startup','naveennvrgup@gmail.com','8940073123','this is a startup','<p>this is a startup</p>','educational','one','two','tirupur','tamilnadu','india',0,'2019-08-28 13:43:01.300889','2019-08-28 13:43:01.300960',917),(317,'test','procoder9973@gmail.com','1234','1','1','1','1','1','1','1','1',0,'2019-08-29 04:15:13.097767','2019-08-29 04:15:13.097847',13),(318,'Bridgingo','isha@bridgingo.com','7828900400','bridgingo is a cloud-based virtual learning platform for collaborative learning and personalized tracking developed by Innolat Technologies. The platform offers wide variety of courses for engineering students and freshers who wish to build a career in IT','<p><span style=\"color: rgb(119,119,119);background-color: rgb(255,255,255);font-size: 12px;font-family: Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\">There is a huge gap between industry expectations and the current skill level of graduates in India. We believe that the key lies in connecting the dots between offline and online learning by combining the unique merits of both to offer a personalized learning experience.Its data analytics driven smart dashboard gives you real-time analytics and your performance statistics. Students can learn industry relevant skills, attend webinars on latest technologies, complete assignments, virtually interact with industry-experts and peers for immediate query resolution during an year-long engagement on the platform.</span></p>\n<p></p>','Education','412, Golden trade center','New Rajendra Nagar','Raipur','CHHATISHGARH','India',1,'2019-08-30 07:52:08.312349','2019-08-30 09:25:14.437443',1171),(319,'TECHB','techbmanish@gmail.com','7587032457','CNC Machine and iot based company','<p>We are manufacturing cnc machines and 3d printers and develop iot based solutions for schools, students and in agriculture domain.&nbsp;</p>','Engineering','Techb office supela','Bhilai','Bhilai','Chhattisgarh','India',1,'2019-08-30 08:26:38.805991','2019-08-30 09:25:15.985091',1174);
