INSERT INTO `mentors_mentor` VALUES (1,'SHRAVAN PUNNA','','placeholder@gmail.com','Consultant at Deloitte','Competent Communicator for displaying excellence in public speaking and a competent leader','static/uploads/mentors/IMG_20190525_162104.jpg',1,2018,'2019-07-26 13:44:25.544443','2019-07-26 13:44:25.544515',NULL),(2,'VAIBHAV SURYA','','placeholder@gmail.com','Digital Marketing Manager at Oppo','Digital sumo is a leading digital marketing agency in MP & CG .They are advance digital advertising company which provides digital & social media marketing training and services to their clients so they will perform extraordinary in their business. They are innovative digital marketing service provider mainly focus on small –medium business enterprises ,marketing professionals & marketing students.\r\nThey are top 3 SEO,SEM & PPC advertsing agency in indore mainly works with various startups in  Healthcare ,Education,E-commerce ,Fashion & many more.','static/uploads/mentors/IMG_20190525_162119.jpg',1,2018,'2019-07-26 13:44:31.348031','2019-07-26 13:44:31.348061',NULL),(3,'Tushar Vadera','0','tushar@innolat.com','CEO - Innolat','CEO - Innolat','static/uploads/mentors/IMG_20190525_161131.jpg',1,2017,'2019-07-26 13:44:35.959696','2019-07-26 13:44:35.959760',NULL),(4,'Vineet Budki','0','ineet.budki@guiddoo.com','Founder & CEO - Guiddoo World','Founder & CEO - Guiddoo World','static/uploads/mentors/IMG_20190525_161951.jpg',1,2017,'2019-07-26 13:44:41.264986','2019-07-26 13:44:41.265047',NULL),(5,'Dr. Shameem S','9876543210','hello@ecell.nitrr.ac.in','Technical University of Munich (Germany)','Great Lakes Institute of Management','static/uploads/mentors/IMG_20190525_162044.jpg',1,2017,'2019-07-26 13:44:45.936236','2019-07-26 13:44:45.936295',NULL),(6,'Ankit Tibrewal','','placeholder@gmail.com','Bharti Airtel Ltd','Financial exec with broad experience in all aspects of accounting, auditing and financial management. Rich experience with real estate, financial consulting. Interested in early-stage startups as well as companies\r\n\r\nSpecialties: Finance & Accounting, Purchasing, Investment, Government Liasion.','static/uploads/mentors/IMG_20190525_134021_1558814989205.jpg',1,2018,'2019-07-26 13:44:50.755345','2019-07-26 13:44:50.755406',NULL),(7,'Ashish Bedakar','1000000000','nomail@gmail.com','Founder and consultant of Bodhi Tree Ecosystem','Founder and consultant of Bodhi Tree Ecosystem','static/uploads/mentors/ab.jpg',0,2019,'2019-08-30 09:14:22.743771','2019-08-30 11:31:04.787443',NULL),(8,'Mohit Grover','1000000000','nomail@gmail.com','Product head at Make MyTrip','Product head at Make MyTrip','static/uploads/mentors/DSC_2800-min.JPG',0,2019,'2019-08-30 09:36:25.184089','2019-08-30 11:30:58.021718',NULL),(9,'Dr. Jawahar Surisetty','1000000000','nomail@gmail.com','Education Advisor and TED Speaker','Education Advisor and TED Speaker','static/uploads/mentors/jawahar-min.png',0,2019,'2019-08-30 09:38:11.004980','2019-08-30 11:30:51.151272',NULL);
